        "import { Fn } from 'packages/wwhooks/src/common/interface';\nimport { useMemo, useRef } from 'react';\n\nexport const usePersistFn = <T extends Fn = Fn>(fn: T) => {\n  const fnRef = useRef<T>();\n  fnRef.current = useMemo(() => fn, [fn]);\n  const persistFn = useRef((...args) => {\n    return fnRef.current(...args);\n  });\n  return persistFn.current as T;\n};\nexport default usePersistFn;",
      O =
        "/**\r\n *\r\n * title: \u57fa\u672c\u7528\u6cd5\r\n * desc: |\r\n * \u7b80\u5355\u793a\u4f8b\r\n *\r\n */\r\nimport React, {\r\n  createContext,\r\n  Dispatch,\r\n  useContext,\r\n  useReducer,\r\n  useState,\r\n} from 'react';\r\n\r\nconst UserContext = createContext(null);\r\nexport interface IState {\r\n  theme: string;\r\n}\r\nconst initState: IState = {\r\n  theme: 'dark',\r\n};\r\n\r\nexport type Action = { type: 'fresh' };\r\n\r\ninterface Context {\r\n  state: IState;\r\n  dispatch: Dispatch<Action>;\r\n}\r\n\r\nconst reducer = (state: IState, action) => {\r\n  switch (action.type) {\r\n    case 'changeTheme':\r\n      return {\r\n        ...state,\r\n        theme: action.value,\r\n      };\r\n    default:\r\n      return state;\r\n  }\r\n};\r\n\r\nfunction Component1() {\r\n  let [state, dispatch] = useReducer(reducer, initState);\r\n  console.log(UserContext);\r\n  return (\r\n    <>\r\n      <UserContext.Provider value={{ state, dispatch }}>\r\n        <h1>{`Hello ${state.theme}!`}</h1>\r\n        <input\r\n          defaultValue={state.theme}\r\n          onChange={(e) =>\r\n            dispatch({ type: 'changeTheme', value: e.target.value })\r\n          }\r\n        ></input>\r\n      </UserContext.Provider>\r\n      <UserContext.Provider value={{ state, dispatch }}>\r\n        <h1>{`Hello ${state.theme}!`}</h1>\r\n        <input\r\n          defaultValue={state.theme}\r\n          onChange={(e) =>\r\n            dispatch({ type: 'changeTheme', value: e.target.value })\r\n          }\r\n        ></input>\r\n        <Component2 />\r\n      </UserContext.Provider>\r\n    </>\r\n  );\r\n}\r\n\r\nfunction Component2() {\r\n  return (\r\n    <>\r\n      <h1>Component 2</h1>\r\n      <Component3 />\r\n    </>\r\n  );\r\n}\r\n\r\nfunction Component3() {\r\n  return (\r\n    <>\r\n      <h1>Component 3</h1>\r\n      <Component4 />\r\n    </>\r\n  );\r\n}\r\n\r\nfunction Component4() {\r\n  return (\r\n    <>\r\n      <h1>Component 4</h1>\r\n      <Component5 />\r\n    </>\r\n  );\r\n}\r\n\r\nfunction Component5() {\r\n  const { state, dispatch } = useContext(UserContext);\r\n\r\n  return (\r\n    <>\r\n      <h1>Component 5</h1>\r\n      <input\r\n        defaultValue={state.theme}\r\n        onChange={(e) =>\r\n          dispatch({ type: 'changeTheme', value: e.target.value })\r\n        }\r\n      ></input>\r\n      <h2>{`Hello ${state.theme} again!`}</h2>\r\n    </>\r\n  );\r\n}\r\nexport default Component1;",
